const express = require('express');
const cors = require('cors');  // Import CORS
const app = express();
const port = process.env.PORT || 3000;

// Enable CORS for all routes
app.use(cors());  // This enables CORS for all domains. You can specify an origin if needed

// AES encryption code as a string to send in the response
const aesCode = ``;// Serve the AES encryption code
app.get('/', (req, res) => {
    // Send the AES encryption code as the response
    res.send(aesCode);
});

// Start the server
app.listen(port, () => {
    console.log(`Server running at http://localhost:${port}`);
});
